INSERT INTO `ecs_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `sales_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `is_shipping`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `goods_shipai`, `comments_number`, `sales_volume`, `bb_chicun`, `mobile_desc`, `sales_volume_base`, `fencheng`, `one_level_deduct`, `two_level_deduct`, `three_level_deduct`, `is_join`, `cost_price` ) VALUES  ('21', '47', 'ECS000021', '蜜丝佛陀纤柔眼线液1#0.75ml', '+', '563', '40', '10', '', '37', '0.000', '98.00', '75.00', '0.00', '0', '0', '1', '2008年03月 GSM,900,1800,1900,2100 直板 1600万 240×400 像素 2007年12月 200万摄像头 黑色', '', '<p>\r\n	<br />\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>标准配置: 标准锂电池两块,充电器两个,立体声耳机一个,数据线,说明书送256TF</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>通讯功能&nbsp; 输入法 短信功能 话机通讯录 通话记录</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>输入法: 中文输入法</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>短信功能: 支持短信300条和彩信100条</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>话机通讯录: 1000组名片式电话存储 来电防火墙功能&nbsp; 来电大头贴及来电铃声识别</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>通话记录：支持电话录音,恢复/静音,双音多频,免提</span></span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span>高级功能</span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>多媒体娱乐: 200万像素，最大支持10240*960，11级数码变焦,多种效果设置,连拍可全屏查看拍摄或下载的图片.支持有声MP4短片拍摄，录像时间根据内存 大小而定，拍摄录像,TV电视可跟朋友家人一起分享。支持网络摄像头功能 支持MPEG4、3GP(H.263)等视频格式 支持MP3等音频格式播放， 支持歌词播放</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>内置游戏:智能拼图</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>扩展存储功能:支持TF扩展,支持U盘功能,本机内置1M,随机赠送256TF卡</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>高级功能:直板/智能PDA手写/键盘输入 超长待机 WAP上网&nbsp; 录音 蓝牙 FM收音机 电子书 Java扩展 TV电视输出 声控语音拨号 免费电视 来电防火墙&nbsp;&nbsp;&nbsp;</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>附加功能: 日历 计算器 闹钟 记事本 日程表 秒表 单位换算</span></span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:medium;\"><span>提醒 以上性能均为本公司员工试机后所写,产品资料仅供参考,请以收到实物为准</span></span>\r\n</p>', 'images/201311/thumb_img/21_thumb_G_1385075715191.jpg', 'images/201311/goods_img/21_G_1385075715772.jpg', 'images/201311/source_img/21_G_1385075715028.png', '1', '', '1', '1', '0', '0', '1241970634', '100', '0', '0', '0', '0', '0', '0', '1425540727', '9', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', '10', '0', '0', '0', '0', '');
